class Dialogue extends React.Component {
    render() {
        return (
            <Dialog
  onDismiss={() => {
    setDefaultAnimationDialog(false);
  }}
  width={0.9}
  visible={defaultAnimationDialog}
  rounded
  actionsBordered
  dialogTitle={
    <DialogTitle
      title="Default Animation Dialog Simple"
      style={{
        backgroundColor: '#F7F7F8',
      }}
      hasTitleBar={false}
      align="left"
    />
  }
  footer={
    <DialogFooter>
      <DialogButton
        text="CANCEL"
        bordered
        onPress={() => {
          setDefaultAnimationDialog(false);
        }}
        key="button-1"
      />
      <DialogButton
        text="OK"
        bordered
        onPress={() => {
          setDefaultAnimationDialog(false);
        }}
        key="button-2"
      />
    </DialogFooter>
  }>
  <DialogContent
    style={{
      backgroundColor: '#F7F7F8',
    }}>
    <Text>
      Here is an example of default animation dialog
    </Text>
  </DialogContent>
</Dialog>

    )}
}

export default Dialogue
